  input: TEXT,F3A,,"This memorandum is submitted by the Committee Treasurer in response
    to the letter of the FEC dated February 12, 2007, with respect to the Committee's
    amended October Quarterly Report (7/20/06 - 9/30/06).    1.  The discrepancies
    in the figures for the Summary and Detailed Summary Page were previously corrected
    by filing of an Amended October (2006) Quarterly Report.  2.  The aggregate election
    cycle -to-date totals for DTE Energy Co. PAC, Human Rights Campaign Fund and the
    Federal National Mortgage Association PAC have been corrected by the merging of
    duplicate entries in our data base.  3.  The description for the purpose of a
    Committee's contribution to the Democratic Congressional Campaign Committee has
    been changed from 'Annual Dues' to 'Unlimited transfer to a National Party Committee'.  No
    other changes were made to the subject Amended October Quarterly Report (2006).  "
